import React from "react";

// Import CSS
import "./index.css";

// Import Navbar Component
import Navbar from "./components/navbar";

// Import Main Component
import Main from "./components/main";

// Make Page (Main) Component
export default function App() {
  return (
    <div>
      <Navbar />
      <Main />
    </div>
  );
}
